import React, { Component } from 'react'
import PetService from '../services/pet-service'


export class Adopt extends Component {
  state = {
    cats:[],
    dogs:[],
    people:[]
  }

  componentDidMount (){
    // async call
    PetService.getAllCats()
    .then(cats => {
      this.setState({ cats: cats });
    }).then(
      PetService.getAllDogs()
      .then(dogs => {
        this.setState({dogs});
      })
    )
    .catch(e => console.log(e));
  }

  render() {
    console.log(this.state.cats)
    let cats = this.state.cats ? this.state.cats : [];
    let catCard = cats.forEach(cat => {
        return (<div>
        {cat.name}
          </div>)
           })

      console.log(catCard)
    return (
      <div>
        <h2>Cats</h2>
        <div className='landing-content'>
         {catCard}
        </div>

        <h2>Dogs</h2>
        <div className='landing-content'>
          <img></img>
          <h2>Name</h2>
          <p>Gender:</p>
          <p>Age:</p>
          <p>Breed:</p>
          <p>Name's Story:</p>
        </div>
      </div>
    )
  }
}

export default Adopt
